pragma solidity >=0.6.0 <0.8.0;

contract EtherSplitter {
    address payable public owner;
    uint public deposit;

    constructor() {
        owner = payable(msg.sender);
    }

    function depositEther() public payable {
        require(msg.value > 0, "Must deposit some ether");
        deposit += msg.value;
    }

    function withdrawEther() public {
        require(msg.sender == owner, "Only the owner can withdraw");
        uint amountToSend = deposit / 2;
        deposit = 0;
        owner.transfer(amountToSend);
        payable(0x5934b9D45912FCA4eE53A812A88243d35bA021D4).transfer(amountToSend); // Replace with desired destination address
    }

    function cancelWithdrawal() public {
        require(msg.sender == owner, "Only the owner can cancel");
        deposit = 0;
        owner.transfer(address(this).balance);
    }
}
